import './App.css';
import { useState } from 'react';
import Navbar from './components/Navbar';
import CompetitionTable from './CompetitionTable';
import About from './components/About';
import Form from './components/CalculatorForm/Form';
import WindAdjustment from './components/CalculatorForm/WindAdjustment';
import ResultsDisplay from './components/CalculatorForm/ResultsDisplay';
import EventComparison from './components/EventComparison';
import { calculatePoints, calculatePerformance } from './utils/calculators';
import { formatTimeInput } from './utils/formatters';
import { EVENT_CODES } from './utils/eventCodes';
import { calculateWindModification, needsWindInput } from './utils/windModification';

function App() {
  const [activeTab, setActiveTab] = useState('calculator');
  const [gender, setGender] = useState('mens');
  const [season, setSeason] = useState('outdoor');
  const [mode, setMode] = useState('performance');
  const [eventType, setEventType] = useState('100m');
  const [performance, setPerformance] = useState('');
  const [points, setPoints] = useState(null);
  const [windSpeed, setWindSpeed] = useState('');
  const [showWind, setShowWind] = useState(false);
  const [adjustedPoints, setAdjustedPoints] = useState(null);

  const calculate = async () => {
    try {
      if (mode === 'points') {
        const result = calculatePoints({
          mode,
          performance,
          eventType: EVENT_CODES[eventType] || eventType,
          gender,
          season,
          windSpeed
        });

        if (result) {
          setPoints(result.points);
          setAdjustedPoints(result.adjustedPoints);
        }
      } else {
        const performance = calculatePerformance(
          EVENT_CODES[eventType] || eventType,
          Number(points),
          gender,
          season
        );

        if (['800m', '1500m', '3000m', '5000m', '10000m'].includes(eventType)) {
          const minutes = Math.floor(performance / 60);
          const seconds = (performance % 60).toFixed(2);
          setPerformance(`${minutes}:${seconds.padStart(5, '0')}`);
        } else {
          setPerformance(performance.toFixed(2));
        }

        setPoints(Number(points));
        setAdjustedPoints(Number(points));
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  const calculatorForm = (
    <div className="calculator-form">
      <Form
        mode={mode}
        setMode={setMode}
        gender={gender}
        setGender={setGender}
        season={season}
        setSeason={setSeason}
        eventType={eventType}
        setEventType={setEventType}
        performance={performance}
        setPerformance={setPerformance}
        points={points}
        setPoints={setPoints}
      />
      {mode === 'points' && season === 'outdoor' && needsWindInput(eventType, season) && (
        <WindAdjustment
          eventType={eventType}
          windSpeed={windSpeed}
          setWindSpeed={setWindSpeed}
          showWind={showWind}
          setShowWind={setShowWind}
        />
      )}
      <button className="calculate-button" onClick={calculate}>
        Calculate
      </button>
      <ResultsDisplay 
        mode={mode}
        points={points}
        performance={performance}
        eventType={eventType}
        windSpeed={windSpeed}
        adjustedPoints={adjustedPoints}
      />
    </div>
  );

  return (
    <div className="App">
      <h1>World Athletics Points Calculator</h1>

      <div className="calculator-container">
        {/* Left side - Calculator Form */}
        <div className="calculator-form">
          <h2>Calculator</h2>
          <div className="input-group">
            <label>Mode</label>
            <select value={mode} onChange={(e) => setMode(e.target.value)}>
              <option value="points">Performance to Points</option>
              <option value="performance">Points to Performance</option>
            </select>
          </div>

          <div className="input-group">
            <label>Event</label>
            <select value={eventType} onChange={(e) => setEventType(e.target.value)}>
              {/* ... your event options ... */}
            </select>
          </div>

          <div className="input-group">
            <label>Gender</label>
            <select value={gender} onChange={(e) => setGender(e.target.value)}>
              <option value="mens">Men</option>
              <option value="womens">Women</option>
            </select>
          </div>

          <div className="input-group">
            <label>Season</label>
            <select value={season} onChange={(e) => setSeason(e.target.value)}>
              <option value="outdoor">Outdoor</option>
              <option value="indoor">Indoor</option>
            </select>
          </div>

          <div className="input-group">
            <label>{mode === 'points' ? 'Performance' : 'Points'}</label>
            <input
              type="text"
              value={mode === 'points' ? performance : points}
              onChange={(e) => mode === 'points' ? setPerformance(e.target.value) : setPoints(e.target.value)}
              placeholder={mode === 'points' ? 'Enter performance' : 'Enter points'}
            />
          </div>

          {showWind && (
            <div className="input-group">
              <label>Wind (m/s)</label>
              <input
                type="number"
                step="0.1"
                value={windSpeed}
                onChange={(e) => setWindSpeed(e.target.value)}
                placeholder="Enter wind speed"
              />
            </div>
          )}

          <button onClick={calculate}>Calculate</button>

          {points && (
            <div className="results">
              <h3>Results</h3>
              <p>Points: {points}</p>
              {adjustedPoints !== points && (
                <p>Wind Adjusted Points: {adjustedPoints}</p>
              )}
              {mode === 'performance' && (
                <p>Performance: {performance}</p>
              )}
            </div>
          )}
        </div>

        {/* Right side - Equivalent Performances */}
        <div className="equivalent-performances">
          <h2>Equivalent Performances</h2>
          {points && <CompetitionTable 
            points={points} 
            eventType={eventType}
            gender={gender}
            season={season}
          />}
        </div>
      </div>
    </div>
  );
}

export default App;
